import React from 'react'
import v4 from 'uuid'

class Portfolio extends React.Component {

    state = {
        userStocks: []
    }

    componentDidMount() {
        fetch(`http://localhost:3000/userstocks`, {
            method: "POST", 
            body: JSON.stringify({id:1}),
            headers:{
                'Content-Type': 'application/json'
            }
        })
        .then( res => res.json())
        .then( res => {
            this.setState({
                userStocks: [...res]
            })
        })
    }

    renderStocks = () => {
        return this.state.userStocks.map(userStock => {
            return (
                <div key={ v4() }>{userStock.stock.ticker}</div>
            )
        })
    }

    render() {
        console.log(this.state.userStocks)
        return (
            <>
                <h1>Portfolio</h1>
                <div>{this.renderStocks()}</div>

            </>
        )
    }
}

export default Portfolio
